const TableHead = () => {
    return (
    <thead>
        <tr>
            <th>Autores</th>
            <th>Livros</th>
            <th>Pre√ßos</th>
            <th>Remover</th>
        </tr>
    </thead>
    );
}

const TableBody = () => {
    return(
    <tbody>
        <tr>
            <td>Paulo</td>
            <td>React</td>
            <td>1000</td>
